import React from 'react';
import logo from './logo.svg';
import './App.css';
import Meters from './components/meters/meters';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo"/>
      </header>
      <Meters />
    </div>
  );
}

export default App;
